import React from 'react';
import Main from './Main';
import ChartComponent from './ChartComponent';
import DoughnutChart from './DoughnutChart';

const Dashboard = () => {
  return (
    <Main>
      <ChartComponent />
      <DoughnutChart />
    </Main>
  );
};

export default Dashboard;
